 touring member of Green Day from 1999 until 2012, when he became an official member of the band, However in 2016 he was demoted back to being a touring member. He is also the guitarist and vocalist for the Californian punk band Pinhead Gunpowder, and co-founder of Adeline Records alongside Billie Joe Armstrong.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:485:\"<p>Jason White (born November 11, 1973) is an American musician best known as the current touring guitarist for the American punk rock bandGreen Day. He played as a touring member of Green Day from 1999 until 2012, when he became an official member of the band, However in 2016 he was demoted back to being a touring member. He is also the guitarist and vocalist for the Californian punk band Pinhead Gunpowder, and co-founder of Adeline Records alongside Billie Joe Armstrong.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:16:\"field_first_name\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:5:\"Jason\";s:6:\"format\";N;s:10:\"safe_value\";s:5:\"Jason\";}}}s:17:\"field_middle_name\";a:0:{}s:15:\"field_last_name\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:5:\"White\";s:6:\"format\";N;s:10:\"safe_value\";s:5:\"White\";}}}s:14:\"field_headshot\";a:1:{s:3:\"und\";a:1:{i:0;a:17:{s:3:\"fid\";s:2:\"11\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:24:\"jason-white-headshot.jpg\";s:3:\"uri\";s:33:\"public://jason-white-headshot.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"71622\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1472099117\";s:4:\"type\";s:5:\"image\";s:25:\"field_file_image_alt_text\";a:0:{}s:27:\"field_file_image_title_text\";a:0:{}s:11:\"rdf_mapping\";a:0:{}s:8:\"metadata\";a:2:{s:6:\"height\";i:300;s:5:\"width\";i:300;}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:6:\"height\";s:3:\"300\";s:5:\"width\";s:3:\"300\";}}}s:17:\"field_action_shot\";a:1:{s:3:\"und\";a:1:{i:0;a:17:{s:3:\"fid\";s:2:\"12\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s: