INSERT INTO `search_dataset` VALUES (1,'node',' billie joe armstrong billie joe armstrong born february 17 19721 is an american musician singer songwriter and actor who is best known as the lead vocalist primary songwriter and guitarist of the pop punk rock band green day which he cofounded with mike dirnt he is also a guitarist and vocalist for the punk rock band pinhead gunpowder and provides lead vocals for green day s side projects foxboro hot tubs and the network billie joe armstrong  billie joe armstrong billie joe armstrong  ',0),(2,'node',' mike dirnt michael ryan pritchard 1 born may 4 19721 known professionally as mike dirnt is an american musician best known for being the cofounder bassist backing and occasional lead vocalist of the american punk rock band green day he has also played in several other bands including the frustrators his stage name was originally a nickname from his friends at grade school as he would constantly play air bass and make a dirnt dirnt dirnt noise while pretending to pluck the strings michael ryan pritchard  mike dirnt  ',0),(3,'node',' tre cool frank edwin wright iii born december 9 1972 known professionally as tré cool is a germanborn american drummer best known as the drummer for the american punk rock pop punk band green day he replaced the band s former drummer john kiffmeyer in 1990 cool has also played in the lookouts samiam and the green day sideprojects the network and the foxboro hot tubs frank edwin wright iii  tre cool  ',0),(4,'node',' jason white jason white born november 11 1973 is an american musician best known as the current touring guitarist for the american punk rock bandgreen day he played as a touring member of green day from 1999 until 2012 when he became an official member of the band however in 2016 he was demoted back to being a touring member he is also the guitarist and vocalist for the californian punk band pinhead gunpowder and cofounder of adeline records alongside billie joe armstrong jason white  jason white  ',0),(5,'node',' green day green day is an american punk rock band formed in 1986 by vocalist guitarist billie joe armstrong and bassist mike dirnt for much of the group s career the band has been a trio with drummer tré cool who replaced former drummer john kiffmeyer in 1990 prior to the recording of the band s second studio album kerplunk 1992 in 2012 guitarist jason white became an official member after having performed with the band as a touring member since 19991 before returning to his role as a touring member in 20162  billie joe armstrong mike dirnt tre cool  green day  ',0),(6,'node',' adeline records adeline records is a record label which was formed in oakland california in late 1997 it was created by billie joe armstrong lead singer of green day screw 32 s doug sangalang green day guitarist jason white and professional skateboarder jim thiebaud 12 green day s management company pat magnarella management now owns the label adeline records was named after a street adeline street that runs from the port of oakland through west oakland and nobe terminating at ward st and shattuck ave in berkeley 3  billie joe armstrong jason white green day  adeline records  ',0),(7,'node',' dookie dookie is the third studio album by the american punk rock band green day released on february 1 1994 through reprise records 1 it was the band s first collaboration with producer rob cavallo and its major record label debut dookie became a worldwide commercial success peaking at no 2 on the us billboard 200 and charting in seven countries 23 the album helped propel green day and even punk rock music into mainstream popularity 4 dookie was certified diamond by the recording industry association of america for the shipment of 10 million copies grammy award for best alternative music album 1994 adeline records 20000000  ',0);
/*!40000 ALTER TABLE `search_dataset` ENABLE KEYS */;
UNLOCK TABLES;
commit;

